	/**
	 * To string.
	 *
	 * @param separator the separator
	 * @return the string
	 */
	public String toString(String separator) {
		StringBuilder builder = new StringBuilder();

		builder.append(StringUtils.leftPad(StringUtils.EMPTY + reng, 10, separator)).append(separator)
				.append(StringUtils.rightPad(cuenta, 6, separator)).append(separator)
				.append(StringUtils.rightPad(scta, 9, separator)).append(separator)
				.append(StringUtils.rightPad(sscta, 15, separator)).append(separator)
				.append(StringUtils.rightPad(ssscta, 6, separator)).append(separator)
				.append(StringUtils.rightPad(sssscta, 7, separator)).append(separator)
				.append(StringUtils.rightPad(ffin, 5, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e1, 2, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e2, 2, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e3, 2, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e4, 2, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e5, 2, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e6, 2, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e7, 2, separator)).append(separator)
				.append(StringUtils.rightPad(StringUtils.EMPTY + e8, 2, separator)).append(separator)
				.append(StringUtils.leftPad(DecimalUtils.formatDouble(suma), 18, separator)).append(separator)
				.append(StringUtils.leftPad(DecimalUtils.formatDouble(total), 18, separator)).append(separator)
				.append(st);
		return builder.toString();
	}

